import Hobbies from '../image/Hobbies.jpeg'
import Food from '../image/Food.jpeg'
import Tech from '../image/Tech.jpeg'
const PostInfo2 = () => {
  const moreInfo = [
    {
      id: 'post4',
      image2: Hobbies,
      categories2: 'Hobbies',
      postDate2: '4 hours ago',
    },
    {
      id: 'post5',
      image2: Tech,
      categories2: 'Tech',
      postDate2: '5 hours ago',
    },
    {
      id: 'post6',
      image2: Food,
      categories2: 'Food',
      postDate2: '5 hours ago',
    },
  ]
  return (
    <>
      {' '}
      {moreInfo.map((el) => (
        <PostColum2
          key={el.id}
          image={el.image2}
          categories={el.categories2}
          postDate={el.postDate2}
        ></PostColum2>
      ))}
    </>
  )
}

export default PostInfo2
